    (a, b) = (0, 1)
    while len(fibonacci_series) <= n:
        fibonacci_series.append(a)
        (a, b) = (b, a + b)

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    def is_palindrome(num):
        return str(num) == str(num)[::-1]
    prime_fibonacci_sum = 0
    smallest_prime_palindrome = None
    for num in fibonacci_series:
        if num > 1 and is_prime(num):
            prime_fibonacci_sum += num
            if smallest_prime_palindrome is None and is_palindrome(prime_fibonacci_sum):
                smallest_prime_palindrome = prime_fibonacci_sum
    return smallest_prime_palindrome

